INSERT INTO `adminnotification_inbox` VALUES (1,4,'2018-02-07 11:34:34','Are you a Magento Developer? Please participate in our developer survey. ','As a Magento developer, your feedback is critical to the success of the Magento platform. We invite you to complete a survey about your experience developing on the Magento 2 platform. The results will help us improve our product and services to enable your continued success. The survey should take no more than 5-7 minutes to complete and the information you provide will remain strictly confidential. \n\nThanks in advance for your participation. \n\nhttps://www.surveymonkey.com/r/X3KHNV3\n','https://www.surveymonkey.com/r/X3KHNV3',1,1),(2,4,'2018-02-07 13:56:41','New Magento Security Scan Tool is available!','Magento has rolled out a new security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. Our  goal is to assist in ensuring the on-going security of your Magento sites. \n\nSecurity Scan is a free service of Magento, and provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. In addition, you\'ll receive real-time security status of your Magento sites and how to fix potential vulnerabilities.\n\nYou and your team, including authorized developers, can access the new tool directly within your Magento Account. And it is very easy to set up. \n\nTo learn more about the Security Scan Tool, \nlog into your Magento Account at https://account.magento.com/customer/account/.\n\nMy Account &gt; Security Scan','https://account.magento.com/customer/account/',1,1),(3,1,'2018-02-27 19:45:24','Magento Open Source 2.2.3, 2.1.12, and 2.0.18 Enhance Security and Functionality – 2/27/2018','Magento Open Source 2.2.3, 2.1.12, and 2.0.18 include critical security enhancements and feature updates, including support for recent USPS API changes. Review the release notes for more information: http://devdocs.magento.com/guides/v2.2/release-notes/ReleaseNotes2.2.3CE.html, http://devdocs.magento.com/guides/v2.1/release-notes/ReleaseNotes2.1.12CE.html, http://devdocs.magento.com/guides/v2.0/release-notes/ReleaseNotes2.0.18CE.html  \n','http://devdocs.magento.com/guides/v2.2/release-notes/ReleaseNotes2.2.3CE.html',1,1),(4,1,'2018-03-01 06:00:00','Important WeltPixel Product Updates - March 2018','We made multiple product improvements and added new features, we hope you will find them useful. You can download the latest release from your account on www.weltpixel.com. We would like to hear from you - leave a review or report a bug to any of our products. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',1,1),(5,4,'2018-03-09 05:49:09','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\nOnline documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',1,1),(6,4,'2018-03-02 08:00:00','Reward Points is now available for pre-order','Reward Points is now available for pre-order from March 02 to March 08. Let\'s double the effectiveness of your customer engagement with Mageplaza\'s special preorder package. Go explore now and make a big saving of $229!','https://www.mageplaza.com/magento-2-reward-points-extension/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=preorder-reward-points',1,1),(7,4,'2018-03-23 08:00:00','Protect &amp; Secure your online stores.','Mageplaza released Security module designed to keep the bad guys out. It resolves common security issues. Download it for FREE!','https://www.mageplaza.com/magento-2-security/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=security-m2',1,1),(8,1,'2018-04-09 05:04:15','Take Steps to Protect Your Site ','Our goal is to help you deliver the highest level of security to your Magento site. \n\nYou now have access to a security scan tool that enables you to regularly monitor your sites and receive updates regarding known security risks, malware, and unauthorized access. It provides over 30 security tests to identify potential vulnerabilities, such as missing Magento patches, configuration issues, and failure to follow security best practices. Please be sure to set your site up for security scanning – activation is quick and easy. Access today in your Magento account.\n\nYou should also visit our Security Center which provides alerts around potential issues as well as best practices to help you protect your site against issues, such as brute force attacks. Brute-force password guessing attacks continue to target Magento Open Source (formerly Community Edition) sites worldwide and we have published an  article that explains multiple actions you can take to protect your site from such attacks. In some cases, these attacks have resulted in unauthorized administrative access, so it is important to implement these recommendations.\n\nTo visit the Magento Security Center:\nwww.magento.com/security\n\nTo view steps you can take to protect against issues like brute force, go to:\nwww.magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks','https://magento.com/security/best-practices/5-immediate-actions-protect-against-brute-force-attacks',1,1),(9,1,'2018-04-12 06:00:00','Important WeltPixel Product Updates - April 2018','Since last month we made multiple product improvements, added new features and released new products, we hope you will find them useful! You can download the latest release from your weltpixel.com account. We would like to hear from you - leave a review or report a bug to any of our products. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',1,1),(10,4,'2018-04-18 16:49:05','We want your opinion! Take our Digital Ad Tools survey.','We\'d like to invite you to take our online survey on digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/9QQLV67\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/9QQLV67',1,1),(11,3,'2018-04-28 08:00:00','New version 2.8.0 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.0\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.0',1,1),(12,4,'2018-05-02 21:07:10','Magento Open Source 2.2.4 Enables Better Shopping Experiences with Integrated Payment, Tax, and Shipping Solutions – 5/2/2018','The latest release of Magento Open Source empowers merchants to create better shopping experiences with performance enhancements and integrations with Amazon Pay, Klarna, and Vertex. Learn how these features can help you reduce cart abandonment and increase average order value, while simplifying your operations at https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce','https://magento.com/blog/magento-news/create-better-shopping-experiences-magento-commerce',1,1),(13,1,'2018-05-18 06:00:00','Important WeltPixel Product Updates - May 2018, compatibility with Magento 2.2.4','Since last month we made multiple product improvements and aligned compatibility of our products with latest Magento 2.2.4 Open Source and Commerce Cloud B2B. You can download the latest release from your weltpixel.com account. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',1,1),(14,4,'2018-05-24 08:00:00','Preparing for the GDPR: Easy step to implement','Every organisation that processes personal data must be compliant with new GDPR rules on 25 May 2018 and this includes charities and voluntary ...','https://www.mageplaza.com/magento-2-gdpr-extension/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=gdpr-m2',1,1),(15,3,'2018-05-31 00:29:45','New version 2.8.1 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.1\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.1',1,1),(16,4,'2018-06-12 17:06:10','We want your input! Please take our 10 question payments survey.','We\'d like to invite you to take our brief survey on payments. Your input is valuable to us and will help to inform our future products and services.\n\nThe survey should take no more than 5 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/LPV3WVX','https://www.surveymonkey.com/r/LPV3WVX',1,1),(17,1,'2018-06-27 18:45:34','Magento Open Source 2.2.5 delivers important security updates along with performance and functionality enhancements – 6/27/2018','The latest release of Magento Open Source includes important security enhancements along with performance and functionality improvements. With these important updates we strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements. For more information about security updates included in these versions of Magento please see our Security Center: https://magento.com/security/patches/magento-2.2.5-and-2.1.14-security-update','https://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html',1,1),(18,4,'2018-07-10 20:14:32','We want your opinion! Take our brief Sales and Marketing survey.','We\'d like to invite you to take our short survey on sales channels and digital advertising tools. Your input is valuable to us and will help to inform future products.\n\nThe survey should take no more than 3 minutes to complete. \n\nTo get started, go to: \n\nhttps://www.surveymonkey.com/r/ChannelSurvey2018\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/ChannelSurvey2018',1,1),(19,1,'2018-05-17 06:00:00','Important WeltPixel Product Updates - July 2018, compatibility with Magento 2.2.5','Since last month we made multiple product improvements and aligned compatibility of our products with latest Magento 2.2.5 Open Source and Commerce Cloud B2B. You can download the latest release from your weltpixel.com account. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',1,0),(20,4,'2018-07-17 00:00:20','Survey: Help us improve the Admin Panel usability by taking this 5 minute survey.','We\'d like to invite you to take our online survey on Admin Panel Usability. Your input is valuable to us and will help to inform the user experience direction. The survey should take no more than 5 minutes to complete.\n \nTo get started, go to:\nhttps://www.surveymonkey.com/r/SUS-AdHoc-M2','https://www.surveymonkey.com/r/SUS-AdHoc-M2',1,0),(21,4,'2018-07-10 08:00:00','Mageplaza Is Now A Select Magento Extension Builder ','It’s our honor to announce that Mageplaza has successfully formed a partnership with Magento as a Select Magento extension builder.','https://www.mageplaza.com/blog/mageplaza-select-magento-extension-builder.html?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=select-partner',1,0),(22,3,'2018-07-20 08:00:00','Blog v2.7.0 released','Feature: Import data from Wordpress, Aheadworks Blog M1, Magefan Blog M2. Bugfixing and performance improvements. See more.','https://www.mageplaza.com/magento-2-blog-extension/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',1,0),(23,1,'2018-08-02 06:00:00','Important WeltPixel Product Updates - August 2018. (stability and performance improvements)','Since last month we made multiple product improvements, including stability and performance fixes reported by WeltPixel Community. You can download the latest release from your weltpixel.com account. Change logs at this link: https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases ','https://support.weltpixel.com/hc/en-us/articles/115002963573-WeltPixel-Product-Updates-Change-Log-and-New-Releases',1,0),(24,4,'2018-08-06 15:42:38','Join our early access program for Magento Payments. Learn more!','Want to get exclusive access to an upcoming new product before it is released to the public?\n\nWant to help influence new payment features Magento is building?\n\nJoin our Early Adopter Program and play a pivotal role in the validation of one of Magento’s newest products.  You will get access to Magento Payments – the payment solution built for Magento by Magento. Magento Payments enables you to instantly accept payments from your customers, offers the right payment options and allows you to manage financial operations with minimal effort. \n \nWe will be granting access to this program to a select number of merchants - we are looking for active participation and regular feedback.\n\nIf you would like to participate and your business is based in the United States, please send an email to: payments@magento.com','www.magento.com',1,0),(25,4,'2018-08-07 09:16:23','Fastly CDN','Version 1.2.61 is available. You are currently running 1.2.51. Please consider upgrading at your earliest convenience.','',1,0),(26,3,'2018-07-26 08:00:00','Size Chart v1.0.1 released','Unlimited size charts built based on flexible catalog rules, 6 premade standard size chart. See more.','https://www.mageplaza.com/magento-2-size-chart/?utm_source=notification&amp;utm_medium=rss&amp;utm_campaign=released',1,0),(27,4,'2018-08-10 02:12:33','Fastly CDN','Version 1.2.62 is available. You are currently running 1.2.51. Please consider upgrading at your earliest convenience.','',1,0);
