INSERT INTO `cms_page` VALUES (1,'404 Not Found','1column','Page keywords','Page description','no-route','Whoops, our bad...','<dl>\r\n<dt>The page you requested was not found, and we have a fine guess why.</dt>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul></dd>\r\n</dl>\r\n<dl>\r\n<dt>What can you do?</dt>\r\n<dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\r\n<dd>\r\n<ul class=\"disc\">\r\n<li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li></ul></dd></dl>\r\n','2018-02-06 02:28:01','2018-02-06 02:28:01',1,0,'','','',NULL,NULL,NULL,''),(2,'Home page','1column','','','home','Home Page','','2018-02-06 02:28:01','2018-02-06 02:28:01',1,0,'','','',NULL,NULL,NULL,''),(3,'Enable Cookies','1column',NULL,NULL,'enable-cookies','What are Cookies?','<div class=\"enable-cookies cms-content\">\r\n<p>\"Cookies\" are little pieces of data we send when you visit our store. Cookies help us get to know you better and personalize your experience. Plus they help protect you and other shoppers from fraud.</p>\r\n<p style=\"margin-bottom: 20px;\">Set your browser to accept cookies so you can buy items, save items, and receive customized recommendations. Here’s how:</p>\r\n<ul>\r\n<li><a href=\"https://support.google.com/accounts/answer/61416?hl=en\" target=\"_blank\">Google Chrome</a></li>\r\n<li><a href=\"http://windows.microsoft.com/en-us/internet-explorer/delete-manage-cookies\" target=\"_blank\">Internet Explorer</a></li>\r\n<li><a href=\"http://support.apple.com/kb/PH19214\" target=\"_blank\">Safari</a></li>\r\n<li><a href=\"https://support.mozilla.org/en-US/kb/enable-and-disable-cookies-website-preferences\" target=\"_blank\">Mozilla/Firefox</a></li>\r\n</ul>\r\n</div>','2018-02-06 02:28:01','2018-02-06 02:28:01',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Privacy and Cookie Policy','1column',NULL,NULL,'privacy-policy-cookie-restriction-mode','Privacy and Cookie Policy','<div class=\"privacy-policy cms-content\">\n    <div class=\"message info\">\n        <span>\n            Please replace this text with you Privacy Policy.\n            Please add any additional cookies your website uses below (e.g. Google Analytics).\n        </span>\n    </div>\n    <p>\n        This privacy policy sets out how this website (hereafter \"the Store\") uses and protects any information that\n        you give the Store while using this website. The Store is committed to ensuring that your privacy is protected.\n        Should we ask you to provide certain information by which you can be identified when using this website, then\n        you can be assured that it will only be used in accordance with this privacy statement. The Store may change\n        this policy from time to time by updating this page. You should check this page from time to time to ensure\n        that you are happy with any changes.\n    </p>\n    <h2>What we collect</h2>\n    <p>We may collect the following information:</p>\n    <ul>\n        <li>name</li>\n        <li>contact information including email address</li>\n        <li>demographic information such as postcode, preferences and interests</li>\n        <li>other information relevant to customer surveys and/or offers</li>\n    </ul>\n    <p>\n        For the exhaustive list of cookies we collect see the <a href=\"#list\">List of cookies we collect</a> section.\n    </p>\n    <h2>What we do with the information we gather</h2>\n    <p>\n        We require this information to understand your needs and provide you with a better service,\n        and in particular for the following reasons:\n    </p>\n    <ul>\n        <li>Internal record keeping.</li>\n        <li>We may use the information to improve our products and services.</li>\n        <li>\n            We may periodically send promotional emails about new products, special offers or other information which we\n            think you may find interesting using the email address which you have provided.\n        </li>\n        <li>\n            From time to time, we may also use your information to contact you for market research purposes.\n            We may contact you by email, phone, fax or mail. We may use the information to customise the website\n            according to your interests.\n        </li>\n    </ul>\n    <h2>Security</h2>\n    <p>\n        We are committed to ensuring that your information is secure. In order to prevent unauthorised access or\n        disclosure, we have put in place suitable physical, electronic and managerial procedures to safeguard and\n        secure the information we collect online.\n    </p>\n    <h2>How we use cookies</h2>\n    <p>\n        A cookie is a small file which asks permission to be placed on your computer\'s hard drive.\n        Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n        a particular site. Cookies allow web applications to respond to you as an individual. The web application\n        can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n        your preferences.\n    </p>\n    <p>\n        We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page\n        traffic and improve our website in order to tailor it to customer needs. We only use this information for\n        statistical analysis purposes and then the data is removed from the system.\n    </p>\n    <p>\n        Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find\n        useful and which you do not. A cookie in no way gives us access to your computer or any information about you,\n        other than the data you choose to share with us. You can choose to accept or decline cookies.\n        Most web browsers automatically accept cookies, but you can usually modify your browser setting\n        to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n    </p>\n    <h2>Links to other websites</h2>\n    <p>\n        Our website may contain links to other websites of interest. However, once you have used these links\n        to leave our site, you should note that we do not have any control over that other website.\n        Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n        visiting such sites and such sites are not governed by this privacy statement.\n        You should exercise caution and look at the privacy statement applicable to the website in question.\n    </p>\n    <h2>Controlling your personal information</h2>\n    <p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n    <ul>\n        <li>\n            whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n            that you do not want the information to be used by anybody for direct marketing purposes\n        </li>\n        <li>\n            if you have previously agreed to us using your personal information for direct marketing purposes,\n            you may change your mind at any time by letting us know using our Contact Us information\n        </li>\n    </ul>\n    <p>\n        We will not sell, distribute or lease your personal information to third parties unless we have your permission\n        or are required by law to do so. We may use your personal information to send you promotional information\n        about third parties which we think you may find interesting if you tell us that you wish this to happen.\n    </p>\n    <p>\n        You may request details of personal information which we hold about you under the Data Protection Act 1998.\n        A small fee will be payable. If you would like a copy of the information held on you please email us this\n        request using our Contact Us information.\n    </p>\n    <p>\n        If you believe that any information we are holding on you is incorrect or incomplete,\n        please write to or email us as soon as possible, at the above address.\n        We will promptly correct any information found to be incorrect.\n    </p>\n    <h2><a name=\"list\"></a>List of cookies we collect</h2>\n    <p>The table below lists the cookies we collect and what information they store.</p>\n    <table class=\"data-table data-table-definition-list\">\n        <thead>\n        <tr>\n            <th>Cookie Name</th>\n            <th>Cookie Description</th>\n        </tr>\n        </thead>\n        <tbody>\n            <tr>\n                <th>FORM_KEY</th>\n                <td>Stores randomly generated key used to prevent forged requests.</td>\n            </tr>\n            <tr>\n                <th>PHPSESSID</th>\n                <td>Your session ID on the server.</td>\n            </tr>\n            <tr>\n                <th>GUEST-VIEW</th>\n                <td>Allows guests to view and edit their orders.</td>\n            </tr>\n            <tr>\n                <th>PERSISTENT_SHOPPING_CART</th>\n                <td>A link to information about your cart and viewing history, if you have asked for this.</td>\n            </tr>\n            <tr>\n                <th>STF</th>\n                <td>Information on products you have emailed to friends.</td>\n            </tr>\n            <tr>\n                <th>STORE</th>\n                <td>The store view or language you have selected.</td>\n            </tr>\n            <tr>\n                <th>USER_ALLOWED_SAVE_COOKIE</th>\n                <td>Indicates whether a customer allowed to use cookies.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-SESSID</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-STORAGE-SECTION-INVALIDATION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-CACHE-TIMEOUT</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>SECTION-DATA-IDS</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>PRIVATE_CONTENT_VERSION</th>\n                <td>Facilitates caching of content on the browser to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>X-MAGENTO-VARY</th>\n                <td>Facilitates caching of content on the server to make pages load faster.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-FILE-VERSION</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n            <tr>\n                <th>MAGE-TRANSLATION-STORAGE</th>\n                <td>Facilitates translation of content to other languages.</td>\n            </tr>\n        </tbody>\n    </table>\n</div>','2018-02-06 02:28:01','2018-02-06 02:28:01',1,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,'Warranty','1column','','','warranty','Warranty','<h1 class=\"title\">Warranty</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h3>Eureka Ergonomic Warranties &amp; 30 Day Risk Free Guarantee</h3>\r\n<p>Eureka Ergonomic offers a best in class warranty effective from date of your purchase which we hope you will love. It applies to Eureka Ergonomic products purchased directly online or from an authorized dealer. Eureka Ergonomic products have been manufactured and tested to the highest quality standards in order to give to you the best sit-stand experience possible. This warranty extends to the original purchaser only and is non-transferable.</p>\r\n<h3>30 Day Risk-Free Purchase Guarantee</h3>\r\n<p>You may return a Eureka Ergonomic product for any reason within 30 days of the date of purchase. We’ll even cover your return shipping costs. Please keep your original shipping box in case you need to return your Eureka product.</p>\r\n<p>Any returns outside of the initial 30-day guarantee window, but before the product warranty window, require customers to pay the freight costs to send the product(s) back to our warehouse.  Please call us on <a href=\"tel: 18009550402\">1 800 955 0402</a>or<a title=\"Eureka Ergonomic Customer Service\" href=\"mailto:customerservice@eurekaergonomic.com\">email</a> and we will issue a RMA# to facilitate your return.</p>\r\n<p>Note that we may ask you to pack your Eureka Ergonomic product in its original box and bring it to your curb for a no-cost pick up. You can also have it picked up from your office or home for an additional fee.</p>\r\n<p>US customers can expect a full refund within 5-7 working days upon the return receipt of your Eureka Ergonomic product. </p>\r\n<h3>PRODUCT WARRANTY</h3>\r\n<p>Customers who have warranty issues with the product should initially either call us or submit a ticket with our customer service team online. <a title=\"Eureka Ergonomic Customer Service\" href=\"mailto:customerservice@eurekaergonomic.com\" target=\"_blank\">CONTACT US</a></p>\r\n<p>Eureka desks come with a limited, best in class product warranty from the date of purchase.  Any failure from normal use will be repaired free of charge. A failure is defined as a mechanical breakdown of or defect in the unit that affects the user\'s ability to operate the product as intended.</p>\r\n<h3>LIMITED WARRANTY</h3>\r\n<p><em><span>Warranty Repairs</span></em>: Any failure from normal usage will be repaired free of charge and we will return the product to you directly at our cost. A failure is a mechanical breakdown of or defect in the unit that affects the user\'s ability to operate the product as intended. If it is determined that the failure was caused by misuse or abuse of the product, repairs and return shipping will be at the customer’s expense. No refunds are available after the initial 30-day risk free period.</p>\r\n<p><strong>This warranty does not cover any problem that is caused by:</strong></p>\r\n<ol>\r\n<li>Conditions, malfunctions or damage not resulting from defects in material or workmanship.</li>\r\n<li>Conditions, malfunctions or damage resulting from normal wear and tear, improper installation, impact by foreign objects, misuse, abuse, negligence, accident, fire or any alterations.</li>\r\n<li>Use with accessories, connected materials and products, or related products which are not manufactured by Eureka.</li>\r\n<li>The scratches on the product are out of the warranty.</li>\r\n</ol>\r\n<p>This warranty shall not be extended or restarted upon purchase of installation of any replacement part. Our limited warranty will be invalid if a product is returned with removed, damaged or tampered or any changing (including removal of any component or external cover).</p>\r\n<p>Items damaged in transit may be returned or replaced under our guarantee. We may ask for photographic or video evidence for our records.</p>\r\n<h3>CANCELLED ORDERS</h3>\r\n<p>If you need to cancel your order, please contact your customer service team at <a href=\"tel: 8444162090\">(844) 416-2090</a> or <a title=\"Eureka Ergonomic Customer Service\" href=\"mailto:customerservice@eurekaergonomic.com\">Email</a>.</p>\r\n<p>Once the item is rerouted back to our warehouse and we verify receipt, you will be issued a full refund. This usually takes a few days.</p>\r\n<p>The Eureka Ergonomic team is here to help.<a href=\"mailto:customerservice@eurekaergonomic.com\">Contact Us</a></p>\r\n<p>Eureka Ergonomic is a trademark and brand of Eureka LLC (Copyright) 2018.</p>\r\n</div>','2018-05-31 00:32:38','2018-05-31 00:32:38',1,0,'','','',NULL,NULL,NULL,'Warranty'),(6,'FAQs','1column','','','faqs','FAQs','<h1 class=\"title\">FAQs</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h1 class=\"center\">Eureka Ergonomic Frequently Asked Questions</h1>\r\n<h4>Do I need to fasten or permanently mount the sit-stand desk on the existing desk ?</h4>\r\n<p>The Eureka Desk is engineered for stability and does not need to be fixed by the user. Just open the box and place it on your desk.</p>\r\n<h4>Does the Eureka Desk need to be assembled ?</h4>\r\n<p>The Eureka Desk is ready to use right out of the box: just open the package and place on your desk! No assembly is required.</p>\r\n<h4>Is shipping free ?</h4>\r\n<p>We ship anywhere in the Continental U.S. (excludes Alaska and Hawaii) for free.</p>\r\n<h4>Do you offer international shipping ?</h4>\r\n<p>We ship overseas, however shipping charges may incur.</p>\r\n<h4>How can I find the serial number on my Eureka Desk?</h4>\r\n<p>The unique Eureka serial number is located on the sticker label on <span>the reverse side of the desktop</span>.</p>\r\n<h4>Do you offer a warranty on the Eureka Desk ?</h4>\r\n<p>Each Eureka Desk comes with a best-in-class 3-year limited warranty. To learn more, for more information please visit: <a href=\"{{store url=\"warranty\"}}\">www.eurekaergonomic.com/warranty</a>.</p>\r\n<h4>How much space do I need to place the Eureka Desk on an existing table/desk ?</h4>\r\n<p>To find the exact measurements, please review the technical specifications of the Eureka Desk product page, your desk/surface will require a a minimum width of at least 36” and depth of 24”.</p>\r\n<h4>Can I fit two monitors on the Eureka Desk ?</h4>\r\n<p>Yes of course! The workspace available on the Eureka Desk can fit up to two 21” monitors side-by-side.</p>\r\n<h4>What is the maximum weight load of the desk ?</h4>\r\n<p>The Eureka Desk is engineered for stability and can hold up to 35lbs safely.</p>\r\n<h4>Does the Eureka Desk make any noise when lifting?</h4>\r\n<p>Thanks to our patented gas strut mechanism the Eureka Desk is virtually silent, keeping you focused and without worry of distracting anyone nearby.</p>\r\n<h4>Do I need a wireless mouse keyboard? Can I use a wired mouse keyboard ?</h4>\r\n<p>If using wired products on the Eureka Desk, we recommend to use a wire length of 5 feet or longer to ensure that the desk can be raised without pulling.</p>\r\n<h4>Does the Eureka Desk require any maintenance ?</h4>\r\n<p>The Eureka Desk does not require any maintenance! Use a damp cloth to clean the surface for a simple wipe down to keep your desk clean and tidy. Please do not use any chemicals or harsh abrasives as they may damage the finish.</p>\r\n<h4>For Further Information</h4>\r\n<p>For further information please feel free to contact our support or sales team at (844) 416-2090. You can always Live Chat during office hours for the quickest response. </p>\r\n</div>','2018-06-04 07:04:19','2018-06-04 07:04:19',1,0,'','','',NULL,NULL,NULL,'FAQs'),(8,'About Us','1column','','','about','About Us','<h1 class=\"title\">About Us</h1>\r\n<div class=\"content\">\r\n<h3>The EUREKA ERGONOMIC® Story</h3>\r\n<p>EUREKA ERGONOMIC® was founded in 2017 on a simple principle: The human body was designed to move.</p>\r\n<p>Unfortunately, people don\'t move as much as they could or should—especially at work, where the majority of your time may be spent sitting.</p>\r\n<p>Our company\'s founder was inspired by the California state seal\'s motto \"Eureka\"—Greek for \"I have found it\"—which some say was exclaimed after the discovery of gold that lead to the state’s fabled Gold Rush in 1849.</p>\r\n<p>His \"Eureka moment\" came when he realized he found a way to simultaneously:</p>\r\n<ul>\r\n<li>Get people to move more at work</li>\r\n<li>Give consumers unrivaled value for best-in-class ergonomic office products</li>\r\n</ul>\r\n<p>Our website will allow you to discover more about our stylish, durable and easy-to-use ergonomic products, as well as our commitment to making them with commercial-quality materials that meet or exceed international standards for health and environmental safety.</p>\r\n<p>Now it\'s time for you to create your own Eureka moments.</p>\r\n<p>If you have any questions about finding EUREKA ERGONOMIC® solutions for your office or home, please contact our world-class customer service center.</p>\r\n<p>CONTACT US TODAY:<a href=\"tel:1-844-416-2090\">1-844-416-2090</a></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/about/about-01.jpg\"}}\" /></p>\r\n<div class=\"auto\">\r\n<h3>World-Class Quality is Our Standard</h3>\r\n<ul>\r\n<li>Commercial-Grade Materials that meet or exceed international standards</li>\r\n<li>SGS Top-Rated for Overall Quality when compared to best-in-class sit-stand desks</li>\r\n</ul>\r\n</div>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/about/about-02.jpg\"}}\" /></p>\r\n<div class=\"auto\">\r\n<div class=\"row\">\r\n<div class=\"col-md-6 col-sm-6 col-xs-12\">\r\n<h5>CARB Phase2</h5>\r\n<p class=\"sup\">California Air Resources Board</p>\r\n<p>One of the most stringent emission standards for formaldehyde emissions from composite wood products.</p>\r\n</div>\r\n<div class=\"col-md-6 col-sm-6 col-xs-12\">\r\n<h5>EN71-3</h5>\r\n<p class=\"sup\">European Committee for Standardization</p>\r\n<p>A part of the EU Toy Safety Directive for heavy metals and plastics.</p>\r\n</div>\r\n<div class=\"col-md-6 col-sm-6 col-xs-12\">\r\n<h5>CP65/Proposition65</h5>\r\n<p class=\"sup\">California Office of Environmental Health Hazard Assessment</p>\r\n<p>One of the highest environmental standards in the United States for phthalates and other toxins.</p>\r\n</div>\r\n<div class=\"col-md-6 col-sm-6 col-xs-12\">\r\n<h5>ASTM F963-07</h5>\r\n<p class=\"sup\">U.S. Department of Commerce National Bureau of Standards</p>\r\n<p>A standard consumer safety specification for heavy metals and plastics in toys.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/about/about-03.jpg\"}}\" /></p>\r\n<div class=\"auto\">\r\n<h3>Accelerated LifeCycle Testing and Data Analysis</h3>\r\n<p>Assures durability and reliability of our products</p>\r\n</div>\r\n</div>','2018-06-04 07:40:20','2018-06-04 07:40:20',1,0,'','','',NULL,NULL,NULL,'About Us'),(9,'Free Shipping & Returns','1column','','','shipping-returns','Free Shipping & Returns','<h1 class=\"title\">Shipping &amp; Returns</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h1>We believe the best way to fall in love with our office solutions is by trying them in your own workspace.</h1>\r\n<h3>Shipping - Free Shipping (48 Contiguous US Only)</h3>\r\n<p>We are so confident that you will love the Eureka difference, we offer <strong>FREE GROUND SHIPPING*</strong> and give you 30 days from delivery of your purchase to make sure you are completely happy. If for some reason you decide to return or exchange any products within the 30-day trial, we will give you:</p>\r\n<ul>\r\n<li>A full refund</li>\r\n<li>Schedule a pick-up</li>\r\n<li>Cover your return shipping</li>\r\n</ul>\r\n<p>Orders placed on weekdays ship within 24 hours. Orders placed on weekends or national holidays ship the next business day.</p>\r\n<p>Please keep in mind, shipping times are estimated and not guaranteed - delays may happen due to things like crazy weather, shipping carrier or customs delays, inventory shortages, or other acts beyond our control. However, we\'ll always do our best to get your order to you as soon as possible.</p>\r\n<p>*Lower 48 states only. Customers in Alaska and Hawaii will get a full refund on returns within 30 days but are not eligible for free shipping. For more details please contact Customer Service at <a href=\"tel:+18444162090\">(844) 416-2090 for a shipping quote or </a><a title=\"Returns\" href=\"mailto:customerservice@eurekaergonomic.com\">email</a></p>\r\n<h3>30-Day Risk Free Trial (48 Contiguous US Only)</h3>\r\n<p>We believe the best way to fall in love with Eureka Ergonomic Office Solutions is by trying them in your own workspace. Our 30-Day Risk Free Trial allows you to personally experience the benefits of an active office environment. We are so confident that you will love the Eureka difference, we offer free ground shipping and give you 30 days from delivery of your purchase to make sure you are completely happy. If for some reason you decide to return or exchange any products within the 30-day trial, we will give you a full refund, schedule a pick-up, and cover your return shipping. Please refer to the Return/Refund Information below.</p>\r\n<p>*Customers in Alaska and Hawaii will get a full refund for returns within 30 days but are not eligible for free shipping. Please contact Customer Service for shipping quote.</p>\r\n<h3>Return &amp; Refund Information</h3>\r\n<p>Returns and Exchanges must be requested within 30 days of receipt of your order. Please contact our Customer Service Team to obtain an RMA# (Return Merchandise Authorization) and schedule a pick-up. We suggest that you keep the original packaging during your 30-day trial. If for some reason you do not have it, please let your Customer Service Team Member know so they can send a replacement. Once we receive the return shipment, we will process your full refund. Please allow up to two weeks for a credit to be issued.</p>\r\n</div>\r\n{{block class=\"Magento\\Sales\\Block\\Widget\\Guest\\Form\" template=\"Magento_Sales::guest/form.phtml\" }}','2018-06-04 08:54:33','2018-06-04 08:54:33',1,0,'','','',NULL,NULL,NULL,'Free Shipping & Returns'),(10,'Contact Us','1column','','','contact-us','Contact Us','<h1 class=\"title\">Contact Us</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/contact/contac.jpg}}\" /></p>\r\n<div class=\"content\">\r\n<h3>We\'d Love to Hear From You!</h3>\r\n<p>Have questions about our awesome products? Need help with an order? We\'re here to help! Please feel free to give us a call at (844) 416-2090 or send us an <a title=\"Eureka Ergonomic Contact Us\" href=\"mailto:customerservice@eurekaergonomic.com\">email</a>. You can always Live Chat with our sales &amp; support team. If you have a question after our regular office hours, please fill out the contact form below and we will contact you the next business day. Thanks for Contacting Eureka Ergonomic!</p>\r\n{{block class=\"Magento\\Contact\\Block\\ContactForm\" template=\"Magento_Contact::form.phtml\"}}</div>','2018-06-04 09:39:16','2018-06-04 09:39:16',1,0,'','','',NULL,NULL,NULL,'Contact Us'),(11,'Privacy Policy','1column','','','privacy-policy','Privacy Policy','<h1 class=\"title\">Privacy Policy</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<p>This website is operated by Eureka LLC.  Eureka LLC offers this website, including all information, tools and services available from this site to you, the user, conditioned upon your acceptance of all terms, conditions, policies and notices stated here.</p>\r\n<p>By visiting our site and/ or purchasing something from us, you engage in our “Service” and agree to be bound by the following terms and conditions (“Terms of Service”, “Terms”), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content. </p>\r\n<p>Please read these Terms of Service carefully before accessing or using our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.</p>\r\n<p>Any new features or tools which are added to the current store shall also be subject to the Terms of Service. You can review the most current version of the Terms of Service at any time on this page. We reserve the right to update, change or replace any part of these Terms of Service by posting updates and/or changes to our website. It is your responsibility to check this page periodically for changes. Your continued use of or access to the website following the posting of any changes constitutes acceptance of those changes. </p>\r\n<h3>SECTION 1 – GENERAL CONDITIONS</h3>\r\n<p>We reserve the right to refuse service to anyone for any reason at any time.</p>\r\n<p>You understand that your content may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices.</p>\r\n<p>You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without express written permission by us.</p>\r\n<p>The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms. </p>\r\n<h3>SECTION 2 – ACCURACY, COMPLETENESS AND TIMELINESS OF INFORMATION</h3>\r\n<p>We are not responsible if information made available on this site is not accurate, complete or current. The material on this site is provided for general information only and should not be relied upon or used as the sole basis for making decisions without consulting primary, more accurate, more complete or more timely sources of information. Any reliance on the material on this site is at your own risk.</p>\r\n<p>This site may contain certain historical information. Historical information, necessarily, is not current and is provided for your reference only. We reserve the right to modify the contents of this site at any time, but we have no obligation to update any information on our site. You agree that it is your responsibility to monitor changes to our site.</p>\r\n<h3>SECTION 3 – MODIFICATIONS TO THE SERVICE AND PRICING</h3>\r\n<p>Prices for our products are subject to change without notice.</p>\r\n<p>We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.</p>\r\n<p>We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p>\r\n<h3>SECTION 4 – PRODUCTS OR SERVICES</h3>\r\n<p>We have made every effort to display as accurately as possible the colors and images of our products that appear at the store. We cannot guarantee that your computer monitor’s display of any color will be accurate.</p>\r\n<p>We reserve the right, but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at any time without notice, at the sole discretion of us. We reserve the right to discontinue any product at any time. Any offer for any product or service made on this site is void where prohibited. </p>\r\n<p>We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.</p>\r\n<h3>SECTION 5 – TOOLS</h3>\r\n<p>We may provide you with access to third-party tools over which we neither monitor nor have any control or input.</p>\r\n<p>You acknowledge and agree that we provide access to such tools “as is” and “as available” without any warranties, representations or conditions of any kind and without any endorsement. We shall have no liability whatsoever arising from or relating to your use of optional third-party tools.</p>\r\n<p>Any use by you of optional tools offered through the site is entirely at your own risk and discretion and you should ensure that you are familiar with and approve of the terms on which tools are provided by the relevant third-party provider(s).</p>\r\n<p>We may also, in the future, offer new services and/or features through the website (including, the release of new tools and resources). Such new features and/or services shall also be subject to these Terms of Service.</p>\r\n<h3>SECTION 6 – PERSONAL INFORMATION</h3>\r\n<p>Your submission of personal information through the store is governed by our Privacy Policy. </p>\r\n<p>The company reserves the right to terminate or alter the Privacy Policy at any time without notice to you. Your use of the Site following the posting of any changes to the Privacy Policy constitutes acceptance of those changes.</p>\r\n<h3>SECTION 7 - INFORMATION COLLECTION</h3>\r\n<p>We may be collecting information such as name, address and phone numbers, but not necessarily limited to these variables.  For all visitors to the Site, we may collect and log your IP address. An IP address is a number automatically assigned to your computer whenever you access the Internet. We collect IP address information to better administer our system and to gather aggregate information on visitors to our Site, on how our Site is being used, and on the pages visitors are viewing. For example, the information can be used to let us know what percentage of users come from which country and region. This aggregate information may be shared with other organizations, whether or not affiliated with the Company. To maintain your anonymity, we do not associate IP addresses with records containing personal information. We may use IP address information, however, to personally identify you in order to enforce our legal rights or when required to do so by law enforcement authorities.</p>\r\n<p>At various times, we may run promotions which may ask for additional information. Such information shall be stored in a database with secure access.</p>\r\n<h3>SECTION 8 - COOKIES</h3>\r\n<p>We may also place small data files, called “cookies,” in the browser file of your computer’s hard drive. These cookies automatically identify your browser to our server when you interact with the Site. Most browsers automatically accept these cookies. We may use cookies to determine whether you are logged in to the Site and to temporarily store application data.</p>\r\n<h3>SECTION 9 - SURVEYS</h3>\r\n<p>At times, you may be asked to complete survey questions that appear on the Site. If you agree to participate in the survey, you will b