,'','desk-size','Desk Sizing','<h1 class=\"title\">Desk Sizing</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h3>Find the Perfect-Size EUREKA ERGONOMIC® Sit-Stand Desktop!</h3>\r\n<p>We’ve designed all of our sit-stand desktop converters to fit on the most common-sized desks and to provide adequate space for the most popular computer/monitor configurations.</p>\r\n<p>Every EUREKA ERGONOMIC® product Web page includes complete and accurate dimensions. But, if you know your desk’s available space or aren’t sure about the best solution for you, the chart below will help you quickly find the right EUREKA ERGONOMIC® sit-stand desktop converter.</p>\r\n<p>We offer a no-risk 30-day guarantee for all of our products. If you decide your desk is not the best match for you, we’ll gladly exchange it for free (which includes shipping both the the returned and exchanged desks!).</p>\r\n<table class=\"cms-table\">\r\n<thead>\r\n<tr><th></th><th colspan=\"2\">RECOMMENDED COMPUTER TYPE</th><th colspan=\"2\">NUMBER OF MONITORS†</th><th colspan=\"2\">MINIMUM DESKTOP SPACE NEEDED</th></tr>\r\n<tr><th></th><th>Laptops/Tablets</th><th>Desktop</th><th>Single(max.)</th><th>Dual(max.)</th><th>Width</th><th>Depth</th></tr>\r\n</thead>\r\n<tbody>\r\n<tr><th>46” Sit-Stand Desktop Converter</th>\r\n<td></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>30”</td>\r\n<td>24”</td>\r\n</tr>\r\n<tr><th>36” Sit-Stand Desktop Converter (2nd Generation)</th>\r\n<td></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>36”</td>\r\n<td>22”</td>\r\n</tr>\r\n<tr><th>32” Sit-Stand Desktop Converter</th>\r\n<td></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>25”</td>\r\n<td>24”</td>\r\n</tr>\r\n<tr><th>31-½” Sit-Stand Desktop Converter (Single Arm)</th>\r\n<td></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>20”</td>\r\n<td>23”</td>\r\n</tr>\r\n<tr><th>28” Sit-Stand Desktop Converter (Single Arm)</th>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>22”</td>\r\n<td>20”</td>\r\n</tr>\r\n<tr><th>26” Sit-Stand Desktop Converter (Laptop)</th>\r\n<td></td>\r\n<td><span class=\"cirlcle\"></span></td>\r\n<td></td>\r\n<td></td>\r\n<td>24”</td>\r\n<td>18”</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Recommendations are for monitors placed directly on desktop. To use other single/dual monitor configurations and sizes, please consider our single-monitor and dual-monitor arm desk mounts.</p>\r\n</div>','2018-06-04 10:29:12','2018-06-04 10:29:12',1,0,'','','',NULL,NULL,NULL,'Desk Sizing'),(14,'Bulk Discounts','1column','','','bulk-discounts','Bulk Discounts','<h1 class=\"title\">Bulk Discounts</h1>\r\n<div class=\"content\"><iframe src=\"https://www.youtube.com/embed/hIiyIHIIyc4?rel=0\" width=\"100%\" height=\"600\" frameborder=\"0\" scrolling=\"auto\" allowfullscreen=\"true\"></iframe>\r\n<h3>Buy in Bulk and Save</h3>\r\n<p>Have a new startup or an office that\'s in need of an upgrade? Eureka Ergonomic can help! Whether you work for a corporate office, education, medical, law office, insurance agency, Government agency, or a fortune 500 company we offer great bulk discounts and complete office solutions. Please fill out the contact form below or give us a call at <a href=\"tel:8444162090\">(844) 416-2090</a>.</p>\r\n</div>\r\n{{block class=\"Magento\\Contact\\Block\\ContactForm\" template=\"Magento_Contact::form.phtml\"}}','2018-06-05 01:24:40','2018-06-05 01:24:40',1,0,'','','',NULL,NULL,NULL,'Bulk Discounts'),(15,'Customer Order','1column','','','customer-order','Customer Order','<h1 class=\"title\">Custom Order</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/customer-order.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h3>Want a Custom Desk? Let Us Know, We Can Help!</h3>\r\n<p>We\'re always looking for ways to make our customers happy. Because we manufacture everything in our own factory, we can build you your dream custom desk. Fill out the contact form below with your custom features and upgrades and one of our sales specialists will contact you shortly. Or you can always give us a call at <a href=\"tel:8444162090\">(844) 416-2090</a>. We can\'t wait to hear about your custom ideas!</p>\r\n</div>\r\n{{block class=\"Magento\\Contact\\Block\\ContactForm\" template=\"Magento_Contact::form.phtml\"}}</div>','2018-07-26 02:41:46','2018-07-26 02:41:46',1,0,'','','',NULL,NULL,NULL,'Customer Order'),(16,'Eureka Advantages','1column','','','eureka-advantages','Eureka Advantages','<h1 class=\"title\">Eureka Advantages</h1>\r\n<div class=\"content\"><iframe src=\"https://www.youtube.com/embed/hIiyIHIIyc4?rel=0\" width=\"100%\" height=\"600\" frameborder=\"0\" scrolling=\"auto\" allowfullscreen=\"true\"></iframe>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/advantages-01.jpg\"}}\" /></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/advantages-02.jpg\"}}\" /></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/advantages-03.jpg\"}}\" /></p>\r\n<h4>FOR MORE DETAILS, PLEASE REFER TO THE ATTACHMENT TO THE SGS FULL REPORT</h4>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/about/about-01.jpg\"}}\" /></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/advantages-04.jpg\"}}\" /></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/advantages-05.jpg\"}}\" /></p>\r\n<h4>EUREKA ERGONOMIC® is the Next Generation of Sit-Stand Desks</h4>\r\n</div>','2018-07-26 03:13:23','2018-07-26 03:13:23',1,0,'','','',NULL,NULL,NULL,'Eureka Advantages'),(17,'Complete Office Design','1column','','','complete-office-design','Complete Office Design','<h1 class=\"title\">Complete Office Design</h1>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/home-slider-1.jpg\"}}\" /></p>\r\n<div class=\"content\">\r\n<h1 class=\"center\">BUY IN BULK AND SAVE!</h1>\r\n<p>Have a new startup or have an office that\'s in need on an upgrade? Eureka Ergonomic can help! We offer special bulk discount pricing. Whether you work for corporate office, education, medical, law office, insurance agency, Government agency, or a fortune 500 company we offer great bulk discounts and complete office solutions. Please fill out the contact form below or give one of our complete office solution specialists a call today. <a href=\"tel:8444162090\">(844) 416-2090</a></p>\r\n<p class=\"img\"><img class=\"lazy\" src=\"{{media url=\"wysiwyg/cms/loader.gif\"}}\" data-src=\"{{media url=\"wysiwyg/cms/b2b/whole-office-solution-01.jpg\"}}\" /></p>\r\n</div>','2018-07-26 05:40:36','2018-07-26 05:40:36',1,0,'','','',NULL,NULL,NULL,'Complete Office Design'),(18,'User Guides','1column','','','user-guides','User Guides','<h1 class=\"title\">User Guides</h1>\r\n<div class=\"content\"><iframe src=\"https://www.youtube.com/embed/hIiyIHIIyc4?rel=0\" width=\"100%\" height=\"600\" frameborder=\"0\" scrolling=\"auto\" allowfullscreen=\"true\"></iframe>\r\n<h3>Downloadable User Guides</h3>\r\n<p>We care about our customers. We want to make sure we\'re designing and manufacturing the best products on the market. We manufacture everything in our own factory. We take pride in our innovative ergonomic designs, rigorous testing, and our world class manufacturing process. We hold our products to a high standard and hope you have an excellent experience using Eureka Ergonomic products.</p>\r\n<p>On this page you will find all of our user guides for each Eureka Ergonomic product. These user guides are PDF files that you can download and print. Click the product title for the user guide. If you still have questions or need support please feel free to contact us at <a href=\"tel:8444162090\">(844) 416-2090</a>. You can always Live Chat with one of our support team members during regular business hours Monday through Friday 9:00 A.M. to 5:00 P.M. CST. After regular business hours please email us at <a href=\"mailto:customerservice@eurekaergonomic.com\">customerservice@eurekaergonomic.com</a> or fill out the contact form below and one of our support team members will contact you as soon as possible.</p>\r\n</div>\r\n{{block class=\"Magento\\Contact\\Block\\ContactForm\" template=\"Magento_Contact::form.phtml\"}}','2018-07-26 06:25:37','2018-07-26 06:25:37',1,0,'','','',NULL,NULL,NULL,'User Guides');
